import React from 'react';
import ReactDOM from 'react-dom';

const flname = "bansi khagram";
const tdate = "26/9/2020";
const ttime = "15:44:25 PM";

//that is called template literals

ReactDOM.render( 
    <> 
    <h1>{`my name is ${flname} `}</h1>
    <p>{`Today date is ${tdate} `} </p>
    <p>{`Current Time Is ${ttime}`} </p>
    </>, 
    document.getElementById("root"));
